import React, { useState } from 'react';
import './ScheduleDisplay.css';

function ScheduleDisplay({ schedule, duplicates, matchesCount, eventName }) {
  const [sortField, setSortField] = useState('Match');
  const [sortDirection, setSortDirection] = useState('asc');

  if (!schedule || schedule.length === 0) {
    return <div className="no-data">Nu sunt date de program disponibile</div>;
  }

  const handleSort = (field) => {
    if (sortField === field) {
      setSortDirection(sortDirection === 'asc' ? 'desc' : 'asc');
    } else {
      setSortField(field);
      setSortDirection('asc');
    }
  };

  const sortedSchedule = [...schedule].sort((a, b) => {
    const aVal = a[sortField];
    const bVal = b[sortField];

    if (typeof aVal === 'string') {
      return sortDirection === 'asc'
        ? aVal.localeCompare(bVal)
        : bVal.localeCompare(aVal);
    }

    return sortDirection === 'asc' ? aVal - bVal : bVal - aVal;
  });

  return (
    <div className="schedule-display">
      <div className="schedule-header">
        <h2>ðŸ“‹ Program Generated</h2>
        <p>{eventName} | {matchesCount} meciuri generate</p>

        <div className="schedule-stats">
          <div className={`stat ${duplicates === 0 ? 'perfect' : 'warning'}`}>
            <span className="label">AlianÈ›e Duplicate:</span>
            <span className="value">{duplicates}</span>
            {duplicates === 0 && <span className="badge">âœ¨ Perfect</span>}
          </div>
        </div>
      </div>

      <div className="table-wrapper">
        <table>
          <thead>
            <tr>
              <th onClick={() => handleSort('Match')} className={sortField === 'Match' ? 'sortable active' : 'sortable'}>
                Meci {sortField === 'Match' && (sortDirection === 'asc' ? 'â†‘' : 'â†“')}
              </th>
              <th onClick={() => handleSort('Red 1')} className={sortField === 'Red 1' ? 'sortable active' : 'sortable'}>
                Red 1 {sortField === 'Red 1' && (sortDirection === 'asc' ? 'â†‘' : 'â†“')}
              </th>
              <th onClick={() => handleSort('Red 2')} className={sortField === 'Red 2' ? 'sortable active' : 'sortable'}>
                Red 2 {sortField === 'Red 2' && (sortDirection === 'asc' ? 'â†‘' : 'â†“')}
              </th>
              <th onClick={() => handleSort('Blue 1')} className={sortField === 'Blue 1' ? 'sortable active' : 'sortable'}>
                Blue 1 {sortField === 'Blue 1' && (sortDirection === 'asc' ? 'â†‘' : 'â†“')}
              </th>
              <th onClick={() => handleSort('Blue 2')} className={sortField === 'Blue 2' ? 'sortable active' : 'sortable'}>
                Blue 2 {sortField === 'Blue 2' && (sortDirection === 'asc' ? 'â†‘' : 'â†“')}
              </th>
            </tr>
          </thead>
          <tbody>
            {sortedSchedule.map((match, idx) => (
              <tr key={idx} className={idx % 2 === 0 ? 'even' : 'odd'}>
                <td className="match-number">{match['Match']}</td>
                <td className="red-alliance">{match['Red 1']}</td>
                <td className="red-alliance">{match['Red 2']}</td>
                <td className="blue-alliance">{match['Blue 1']}</td>
                <td className="blue-alliance">{match['Blue 2']}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>

      <div className="export-section">
        <button 
          className="export-btn"
          onClick={() => {
            const csv = [
              ['Match', 'Red 1', 'Red 2', 'Blue 1', 'Blue 2'],
              ...schedule.map(m => [m['Match'], m['Red 1'], m['Red 2'], m['Blue 1'], m['Blue 2']])
            ].map(row => row.join(',')).join('\n');

            const blob = new Blob([csv], { type: 'text/csv' });
            const url = window.URL.createObjectURL(blob);
            const a = document.createElement('a');
            a.href = url;
            a.download = `schedule_${Date.now()}.csv`;
            a.click();
          }}
        >
          ðŸ“¥ DescarcÄƒ CSV
        </button>
      </div>
    </div>
  );
}

export default ScheduleDisplay;
